import React from "react";
import "./ToDoList.css";
import Todo from "./Todo";

function ToDoList(props) {
  return (
    <div className="todo-container">
      {props.todos.map((todo) => (
        <Todo todo={todo} />
      ))}
    </div>
  );
}

export default ToDoList;
